=========================================================

* The above is copyright by ToUpper LLC.

*/
import React from "react";
// node.js library that concatenates classes (strings)
import classnames from "classnames";
// javascipt plugin for creating charts
import Chart from "chart.js";
// react plugin used to create charts
import { Line, Bar } from "react-chartjs-2";
// reactstrap components
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  NavItem,
  NavLink,
  Nav,
  Progress,
  Table,
  Container,
  Row,
  Col
} from "reactstrap";

// core components
import {
  chartOptions,
  parseOptions,
  chartExample1,
  chartExample2
} from "variables/charts.jsx";

import Header from "components/Headers/Header.jsx";
import Stock from "/Users/gregorymoncayo/Desktop/ToUpper LLC/WebSite/src/assets/img/brand/StockUp.jpg";
import Image from 'react-image-resizer';

class Index extends React.Component {
  state = {
    activeNav: 1,
    chartExample1Data: "data1"
  };
  toggleNavs = (e, index) => {
    e.preventDefault();
    this.setState({
      activeNav: index,
      chartExample1Data:
        this.state.chartExample1Data === "data1" ? "data2" : "data1"
    });
    let wow = () => {
      console.log(this.state);
    };
    wow.bind(this);
    setTimeout(() => wow(), 1000);
    // this.chartReference.update();
  };
  componentWillMount() {
    if (window.Chart) {
      parseOptions(Chart, chartOptions());
    }
  }
  render() {
    const mystyle = {
      fontFamily: "Georgia",
      textAlign: 'center!important'
    };

    const imageStyle = {
      float: 'right',
    };

    return (
      <>
        <Header />
        <Image
          src={Stock}
          height={340}
          width={340}
          style={imageStyle}
        />
        <h1><br></br></h1>
        <p style={mystyle}>Since 2019, we have been dedicated to providing users and customers the best experience.</p>
        <p style={mystyle}>At ToUpper LLC, we pride ourselves by providing the most modern look on both our applications and our webpages. 
        <br>
        </br>
        We prepare busineses to have their webpage looking sleek and professional for them to accompish their daily goals.<br></br>
        We pay attention to detail and make sure we do not miss any dotted i's during our process of packaging and publishing software. When creating software, we make sure that we don't go overbudget and provide excellent maintenance to make sure users have a smooth experience when browsing the web or playing one of our games.
        <br></br>
        <br></br>
        Whether your business is real estate, food service, accounting, fashion, or construction, we can provide an excellent website to help establish or improve your business.
        </p>

      </>
    );
  }
}

export default Index;
